import { BrowserRouter, Route } from "react-router-dom";

import Principal from '/paginas/Principal/index.js';
import Cadastro from '/paginas/Cadastro/index.js';
import Login from '/paginas/Login/index.js';

const Rotas = () => {
    return (
        <BrowserRouter>
        <Route exact={true} path="/" component={Principal}/>
        <Route exact={true} path="/Cadastro" component={Cadastro}/>
        <Route exact={true} path="/Login" component={Login}/>
        </BrowserRouter>
    )
}

export default Rotas;
